import Navbar from "./components/Navbar.js"
import Login from "./components/Login.js"
import Dashboard from './components/Dashboard"'
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Routes>
        <Route 
        path="/dashboard" 
        element={<Dashboard />} 
        />
      </Routes>

      <Navbar />
    </>
  )
}

export default App;
